import React, { useContext } from 'react'
import { Myname,Lname } from './Context';

export const App2 = () => {
    const fname=useContext(Myname);
    const lname=useContext(Lname);

    return (
        <>
            <h2>{fname} {lname}</h2>
        </>
    )
}

export default App2;
